window.bookSummaryJSON = "<p>I am a lesser from a servant world.<br> But even before I was taken?<br> There was no rescue for me.<br> The night sky isn’t the only place that’s filled with darkness.<br> And cages look different, but they’re all the same.<br> I might be fragile as glass, but I shielded my daughter with my own body. I’ll withstand these brutal aliens.<br> Their leader. The one who has blades in his wrists and a fractured look in his eyes? I’m all that stands between him and Earth.<br> But now I think I have the advantage.<br> Because he sees through me, which means he doesn't see what's right in front of him.<br> And I’m not afraid of anything.<br> This glass holds oceans. Planets. Stars.<br> Just try and make me break.</p> <p><i>Contains unique alien shifters, fierce passion, and loyal warriors who find their fated mates in the stars. Each full-length audiobook is a complete romance with an epic happily-ever-after. Claim your conqueror today!</i></p>"; 
